import React, { useState, useEffect, useCallback } from "react";
import { getElements, deleteElement, addElement, editElement } from "./api";

import jsPDF from "jspdf";
import 'jspdf-autotable';

const ElementTable = () => {
  const [elements, setElements] = useState([]);
  const [searchTerm, setSearchTerm] = useState(""); // Search input
  const [searchAttribute, setSearchAttribute] = useState("name"); // Default search attribute
  const [showPopup, setShowPopup] = useState(false);
  const [formData, setFormData] = useState({});
  const [editId, setEditId] = useState(null);
  const [errorMessage, setErrorMessage] = useState(""); // Error message state

  // Fetch elements function
  const fetchElements = useCallback(async () => {
      try {
          const filters = searchTerm ? { [searchAttribute]: searchTerm } : {};
          const data = await getElements(filters);
          setElements(data);
          setErrorMessage(""); // Clear errors on success
      } catch (error) {
          setErrorMessage("Failed to fetch elements. Please try again.");
      }
  }, [searchTerm, searchAttribute]);

  // Use effect with fetchElements as dependency
  useEffect(() => {
      fetchElements();
  }, [fetchElements]);

  // Handle delete
  const handleDelete = async (id) => {
      try {
          await deleteElement(id);
          fetchElements();
      } catch (error) {
          setErrorMessage("Failed to delete element. Please try again.");
      }
  };

  // Handle add
  const handleAdd = () => {
      setFormData({});
      setEditId(null);
      setShowPopup(true);
  };

  // Handle edit
  const handleEdit = (element) => {
      setFormData({
          ...element,
          bucket: element.bucket ?? null,
          galon: element.galon ?? null,
          kilo: element.kilo ?? null,
          half_kilo: element.half_kilo ?? null,
          kes: element.kes ?? null,
          date: element.date ?? null, // Ensure date is handled properly
      });
      setEditId(element.id);
      setShowPopup(true);
  };

  // Validate form
  const validateForm = () => {
      if (!editId && elements.some((el) => el.id === parseInt(formData.id))) {
          return `The ID must be unique. The value "${formData.id}" already exists.`;
      }

      const requiredFields = ["id", "name"];
      for (const field of requiredFields) {
          if (!formData[field]) {
              return `${field} is required.`;
          }
      }

      const numericFields = ["bucket", "galon", "kilo", "half_kilo", "kes"];
      for (const field of numericFields) {
          const value = formData[field];
          if (value !== null && value !== "" && value !== undefined && isNaN(value)) {
              return `${field} must be a number or empty.`;
          }
      }

      return null; // No validation errors
  };

  // Handle form submission
  const handleSubmit = async () => {
      const validationError = validateForm();
      if (validationError) {
          setErrorMessage(validationError);
          return;
      }

      try {
          const formattedData = {
              ...formData,
              date: formData.date || null,
              code: formData.code || null,
              customer_name: formData.customer_name || null,
              bucket: formData.bucket || null,
              galon: formData.galon || null,
              kilo: formData.kilo || null,
              half_kilo: formData.half_kilo || null,
              kes: formData.kes || null,
          };

          if (editId) {
              await editElement(editId, formattedData);
          } else {
              await addElement(formattedData);
          }
          setShowPopup(false);
          fetchElements();
      } catch (error) {
          const errorDetails = error.response?.data;
          setErrorMessage(
              Array.isArray(errorDetails)
                  ? errorDetails.map((err) => err.msg).join(", ")
                  : typeof errorDetails === "string"
                  ? errorDetails
                  : "An unexpected error occurred."
          );
      }
  };

  // Handle form input changes
  const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData({
          ...formData,
          [name]: name.match(/bucket|galon|kilo|half_kilo|kes/) && value === "" ? null : value,
      });
  };
  // Base64 string of Noto Sans Arabic (convert the .ttf file to Base64 first)
  const notoSansArabicBase64 = "";

// Add the Arabic font to jsPDF
const addNotoSansArabicFont = (doc) => {
  doc.addFileToVFS("NotoSansArabic-Regular.ttf", notoSansArabicBase64);
  doc.addFont("NotoSansArabic-Regular.ttf", "NotoSansArabic", "normal");
};

// Function to generate and download the PDF
const generatePDF  = () => {
  const doc = new jsPDF();
  addNotoSansArabicFont(doc);

  // Set font to Noto Sans Arabic
  doc.setFont("NotoSansArabic");
  doc.setFontSize(18);

  // Add logo
  const logo = "data:image/jpeg;base64,"; // Replace with your base64-encoded logo

// Center alignment
const centerX = 105; // Center of the page (A4 width is 210mm, so 105mm is the center)
const logoWidth = 70; // Adjusted logo width
const logoHeight = 40; // Adjusted logo height
const spacing = 10; // Spacing between logo and date block

// Add the logo, positioned slightly to the left of the center
const logoX = centerX - (logoWidth + spacing) / 2 - 20; // Adjust for logo and spacing
const logoY = 10; // Top position for the logo
doc.addImage(logo, "PNG", logoX, logoY, logoWidth, logoHeight);

// Add the date block (title + date) to the right of the logo
const dateX = logoX + logoWidth + spacing; // Position the date block to the right of the logo
const titleY = logoY + 10; // Position Arabic title slightly lower than the logo's top
const dateY = titleY + 15; // Position the date slightly lower than the Arabic title

// Arabic title (bold)
doc.setFont("NotoSansArabic", "normal");
doc.setFontSize(14);
doc.text(" ", dateX, dateY, { align: "left" });

// English date
const englishDate = `Date: ${new Date().toLocaleDateString("en-US")}`;
doc.setFont("helvetica", "normal");
doc.setFontSize(12);
doc.text(englishDate, dateX, dateY + 10, { align: "left" });

  // Define table columns and rows
  const tableColumns = [
    "",
    "",
    "Code",
    " ",
    "",
    "",
    "",
    " ",
    "",
  ];
  const tableRows = elements.map((el) => [
    el.id,
    el.name,
    el.code,
    el.customer_name,
    el.bucket,
    el.galon,
    el.kilo,
    el.half_kilo,
    el.kes,
  ]);

  // Add table
  doc.autoTable({
    head: [tableColumns],
    body: tableRows,
    startY: 60, // Position the table below the title
    margin: { left: 20, right: 20 }, // Center the table
    styles: {
      font: "NotoSansArabic",
      fontSize: 10,
      halign: "center", // Center align text
      valign: "middle",
    },
    headStyles: {
      fillColor: [0, 102, 204], // Header background color (blue)
      textColor: [255, 255, 255], // Header text color (white)
      fontSize: 10,
      halign: "center",
    },
    bodyStyles: {
      halign: "center",
      lineColor: [220, 220, 220], // Table border color
      lineWidth: 0.5,
    },
    alternateRowStyles: {
      fillColor: [245, 245, 245], // Light gray for alternate rows
    },
  });

  // Save the PDF
  doc.save("styled_elements_table.pdf");
};


  
  return (
    <div className="page-container">
      <h1 className="table-heading">Elements Table</h1>

      <div className="input-container">
        {/* Dropdown to select attribute */}
        <select
          className="input-field"
          value={searchAttribute}
          onChange={(e) => setSearchAttribute(e.target.value)}
        >
          <option value="name"></option>
          <option value="code">Code</option>
          <option value="id"> </option>
          <option value="date"></option>
          <option value="customer_name">  </option>
          <option value="bucket"></option>
          <option value="galon"></option>
          <option value="kilo"></option>
          <option value="half_kilo">  </option>
          <option value="kes"></option>
          <option value="notes"></option>
        </select>
        {/* Input to search by selected attribute */}
        <input
          className="input-field"
          placeholder={`Search by ${searchAttribute}`}
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <button className="add-button" onClick={handleAdd}>
          Add Element
        </button>
      </div>


      <table  id="table-to-pdf" className="table">
        <thead>
          <tr>
            <th></th>
            <th> </th>
            <th></th>
            <th>Code</th>
            <th> </th>
            <th></th>
            <th></th>
            <th></th>
            <th> </th>
            <th></th>
            <th></th>
            <th>Actions</th>
          
          </tr>
        </thead>
        <tbody>
  
  {Array.isArray(elements) && elements.length > 0 ? (
    elements.map((el) => (
      <tr
        key={el.id}
        onDoubleClick={() => handleEdit(el)}
        className="table-row"
      >
        <td>{el.date}</td>
        <td>{el.id}</td>
        <td>{el.name}</td>
        <td>{el.code}</td>
        <td>{el.customer_name}</td>
        <td>{el.bucket}</td>
        <td>{el.galon}</td>
        <td>{el.kilo}</td>
        <td>{el.half_kilo}</td>
        <td>{el.kes}</td>
        <td>{el.notes}</td>
        <td>
          <button
            className="delete-button"
            onClick={(e) => {
              e.stopPropagation(); // Prevent triggering onDoubleClick
              handleDelete(el.id);
            }}
          >
            Delete
          </button>
        </td>
      </tr>
    ))
  ) : (
    <tr>
      <td colSpan="12" style={{ textAlign: "center" }}>
        No elements found
      </td>
    </tr>
  )}
</tbody>

      </table>

      <button
        onClick={generatePDF}
        className="download-button bg-blue-500 text-white px-4 py-2 rounded mt-4"
      >
        Download as PDF
      </button> 


      {showPopup && (
       <div className="popup-background flex items-center justify-center">
       <div className="popup-container bg-white p-8 rounded shadow-lg w-2/3 max-w-4xl">
         <h2 className="popup-heading text-2xl font-bold mb-6">
           {editId ? "Edit Element" : "Add Element"}
         </h2>
         <div className="grid grid-cols-2 gap-6">
           <div className="flex items-center gap-2">
             <label htmlFor="id" className="w-1/3 text-right font-medium"> </label>
             <input
               id="id"
               name="id"
               value={formData.id || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter ID"
             />
           </div>
           <div className="flex items-center gap-2">
                <label htmlFor="date" className="w-1/3 text-right font-medium"></label>
                <input
                    id="date"
                    name="date"
                    type="date" // Use date input
                    value={formData.date || ""}
                    onChange={handleChange}
                    className="input-field flex-grow"
                    placeholder="YYYY-MM-DD"
                />
                </div>
           <div className="flex items-center gap-2">
             <label htmlFor="name" className="w-1/3 text-right font-medium"></label>
             <input
               id="name"
               name="name"
               value={formData.name || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Name"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="code" className="w-1/3 text-right font-medium">Code</label>
             <input
               id="code"
               name="code"
               value={formData.code || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Code"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="customer_name" className="w-1/3 text-right font-medium"> </label>
             <input
               id="customer_name"
               name="customer_name"
               value={formData.customer_name || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Customer Name"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="bucket" className="w-1/3 text-right font-medium"></label>
             <input
               id="bucket"
               name="bucket"
               value={formData.bucket || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Bucket"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="galon" className="w-1/3 text-right font-medium"></label>
             <input
               id="galon"
               name="galon"
               value={formData.galon || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Galon"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="kilo" className="w-1/3 text-right font-medium"></label>
             <input
               id="kilo"
               name="kilo"
               value={formData.kilo || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Kilo"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="half_kilo" className="w-1/3 text-right font-medium"> </label>
             <input
               id="half_kilo"
               name="half_kilo"
               value={formData.half_kilo || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Half Kilo"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="kes" className="w-1/3 text-right font-medium"></label>
             <input
               id="kes"
               name="kes"
               value={formData.kes || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter Kes"
             />
           </div>
           <div className="flex items-center gap-2">
             <label htmlFor="notes" className="w-1/3 text-right font-medium"></label>
             <input
               id="notes"
               name="notes"
               value={formData.notes || ""}
               onChange={handleChange}
               className="input-field flex-grow"
               placeholder="Enter notes"
             />
           </div>
         </div>
         <div className="flex justify-end gap-4 mt-6">
           <button onClick={handleSubmit} className="submit-button bg-green-500 text-white px-4 py-2 rounded">
           {editId ? "Update" : "Add"} Submit
           </button>
           <button
             onClick={() => setShowPopup(false)}
             className="cancel-button bg-gray-500 text-white px-4 py-2 rounded"
           >
             Cancel
           </button>
         </div>
       </div>
     </div>
      
      )}

{errorMessage && (
        <div className="popup-background">
          <div className="popup-container">
            <h2 className="popup-heading">Error</h2>
            <p>{errorMessage}</p>
            <button
              onClick={() => setErrorMessage("")}
              className="cancel-button mt-4"
            >
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
};
export default ElementTable;
